import { Auth } from "../../API/Api";
import { fetchdaata } from "../Type";

export const GetAuth = () => {

  return (dispatch,getState)=>{
   
     Auth(dispatch,getState)
  }
 
};


export const GetAuth1 = (data)=>{
  return {
    type: fetchdaata,
    payload: data
  };
}
